import React, { Component } from 'react';
import '../../App.css';
import './Listen.css';
import rightSupremacy from '../img/RightSupremacy.jpg';
import agentOrange from '../img/AgentOrange.jpg';

class Listen extends React.Component {

  	/* Showbox will have a hover event for each img.  When you hover, links will appear
  	   that will go to the streaming and listening sites for each album. */

	render () {
		return (
			<div className="listenPage">
				<div className="container">
					<img className="listenImages" id='rightSupremacy' src={rightSupremacy} alt="Right Supremacy Art" />
					<div className="centered">
						<h1 className="title">right supremacy (single)</h1>
						<ul className="list">
							<li className="links">
								<a href="https://pressuresensitive.bandcamp.com/album/agent-orange">
								bandcamp</a>
							</li>
							<li className="links">spotify</li>
							<li className="links">apple</li>
							<li className="links">amazon</li>
						</ul>
						<div class="bottom-left"></div>
						<div class="top-left"></div>
						<div class="top-right"></div>
						<div class="bottom-right"></div>
					</div>
				</div>
				<div className="container">
					<img className="listenImages" id='agentOrange' src={agentOrange} alt="Agent Orange Art" />
					<div id="AOlinks">
						<h1>Agent Orange (Full Length LP)</h1>
						<a href="https://pressuresensitive.bandcamp.com/album/agent-orange">Bandcamp</a>
					</div>
				</div>
	  		</div>
		);
	}
}

export default Listen;
